import { Typography } from "@mui/material";
import SelectField from "../components/SelectField";

const Settings = () => {
  return (
    <div>
      <Typography variant="h2" fontWeight="bold">
        Quiz App
      </Typography>
      <form>
        <SelectField lable="Category" />
      </form>
    </div>
  )
}

export default Settings
